    fun solve() {
        var valid = 0
        var invalidPid = 0
        val validEyeColors = listOf("amb", "blu", "brn", "gry", "grn", "hzl", "oth" )

        for(passport in passports) {
//            if(passport.keys.size == 8) {valid += 1}
//            if(passport.keys.size == 7 && !passport.containsKey("cid")) {valid += 1}
            if (!(passport.containsKey("byr") && passport["byr"]!!.toInt() >= 1920 && passport["byr"]!!.toInt() <=
                2002)) {
               continue
            }
            if (!(passport.containsKey("iyr") && passport["iyr"]!!.toInt() >= 2010 && passport["iyr"]!!.toInt() <=
                    2020)) {
                continue
            }

            if (!(passport.containsKey("eyr") && passport["eyr"]!!.toInt() >= 2020 && passport["eyr"]!!.toInt() <=
                    2030)) {
                continue
            }

            if (!(passport.containsKey("hgt") && listOf("in", "cm").contains(passport["hgt"]!!.takeLast(2)) )) {
                continue
            }




            if ((passport["hgt"]!!.takeLast(2) == "cm")) {
                if (passport["hgt"]!!.length != 5) {
                    continue
                }
                val hgtCmNum = passport["hgt"]!!.take(3).toIntOrNull()
                if(!((hgtCmNum != null) and (hgtCmNum!! >= 150 ) and (hgtCmNum!! <= 193))) { continue }
            } else {
                val hgtInNum = passport["hgt"]!!.take(2).toIntOrNull()
                if(!((hgtInNum != null) and ((hgtInNum!! >= 59) and (hgtInNum!! <= 76)))) { continue }
            }



            if (!(passport.containsKey("hcl"))) {

                continue
            } else {
                val hair = passport.get("hcl")
                if (hair!!.length != 7 ) {
                    continue
                }
                val letters = hair!!.toCharArray()

                if (letters[0] != '#') {
                    continue
                }
                var validHairColor = true
                for ((index, letter) in letters.withIndex()) {
                    if (index != 0 && !letter.isLetterOrDigit())
                    { validHairColor = false }
                }
                if(!validHairColor) {
                    continue
                }
            }

            if (!(passport.containsKey("ecl"))) {
                continue
            } else {
                if(!validEyeColors.contains(passport["ecl"])) {
                    continue
                }
            }



            if (!(passport.containsKey("pid"))) {
                continue
            } else {
                if(passport["pid"]!!.length != 9) {

                    continue
                }
            }
            valid += 1

        }
        println(valid)

    }

//    byr (Birth Year) - four digits; at least 1920 and at most 2002.
//    iyr (Issue Year) - four digits; at least 2010 and at most 2020.
//    eyr (Expiration Year) - four digits; at least 2020 and at most 2030.
//    hgt (Height) - a number followed by either cm or in:
//    If cm, the number must be at least 150 and at most 193.
//    If in, the number must be at least 59 and at most 76.
//    hcl (Hair Color) - a # followed by exactly six characters 0-9 or a-f.
//    ecl (Eye Color) - exactly one of: amb blu brn gry grn hzl oth.
//    pid (Passport ID) - a nine-digit number, including leading zeroes.
//    cid (Country ID) - ignored, missing or not.
}